import React from 'react';
import './App.css';
import { useSelector } from 'react-redux';


function App() {

  const userlist=useSelector((state)=> state.users.value)
  return (
    <div className="App">
        <div className='input'>
          <input
          type='text'
          placeholder='Nmae'
          />
          <input
          type='text'
          placeholder='lastname'
          />
          <button>add user</button>
        </div>

        <div>
          {userlist.map((user)=>{
              return(
                <h1>{user.name}</h1>
              )
          })}
        </div>
    </div>
  );
}

export default App;
